// Copies data from ELPMPP02 series embedded in this C++ source code
// into Kam's main and perturbation series arrays. Only do this once!

void ELPMPP02::initSeries ( void )
{
    if ( ! _init )
    {
        setup_Elp_series ();
        _init = true;
    }
}

