// Reads ELPMPP02 Main Problem series file (filename) into series (ser).
// Returns number of lines read from file.  On success, ser.nt should
// equal ser.terms.size().

int ELPMPP02::readMainSeries ( const string &filename, ELPMainSeries &ser )
{
    // Open file; return on failure.

    ifstream file ( filename );
    if ( ! file )
        return 0;

    // Read file line-by-line until we reach ene-of-file

    string line = "";
    int count = 0;

    if ( ! getline ( file, line ) )
        return ( count );
    
    count++;
    
    if ( line.find ( "LONGITUDE" ) != string::npos )
        ser.iv = 1;
    else if ( line.find ( "LATITUDE" ) != string::npos )
        ser.iv = 2;
    else if ( line.find ( "DISTANCE") != string::npos )
        ser.iv = 3;
    else
        return count;
    
    ser.nt = strtoint ( line.substr ( 31, 4) );
    
    for ( int i = 0; i < ser.nt; i++ )
    {
        if ( ! getline ( file, line ) )
            break;
        
        count++;
        ELPMainTerm term;
        
        term.i[0]  = strtoint ( line.substr ( 0, 3 ) );
        term.i[1]  = strtoint ( line.substr ( 3, 3 ) );
        term.i[2]  = strtoint ( line.substr ( 6, 3 ) );
        term.i[3]  = strtoint ( line.substr ( 9, 3 ) );
        
        term.a =  strtofloat64 ( line.substr ( 14, 13 ) );
        term.b[0] = strtofloat64 ( line.substr ( 27, 12 ) );
        term.b[1] = strtofloat64 ( line.substr ( 39, 12 ) );
        term.b[2] = strtofloat64 ( line.substr ( 51, 12 ) );
        term.b[3] = strtofloat64 ( line.substr ( 63, 12 ) );
        term.b[4] = strtofloat64 ( line.substr ( 75, 12 ) );
        term.b[5] = strtofloat64 ( line.substr ( 87, 12 ) );
        
        ser.terms.push_back ( term );
    }

    sort ( ser.terms.begin(), ser.terms.end(), compareELPMainTerms );
    
#if PRINT_SERIES
    ofstream outfile ( filename + ".cpp" );
    if ( outfile )
        printMainSeries ( outfile, ser );
#endif
    
    return count;
}

// Reads ELPMPP02 Perturbation series file (filename) into series vector (pert).
// Returns number of lines read from file.  On success, vector should have a nonzero
// number of ELPPertSeries, and for each, pert[i].nt should equal pert[i].terms.size().

int ELPMPP02::readPertSeries ( const string &filename, vector<ELPPertSeries> &pert )
{
    // Open file; return on failure.

    ifstream file ( filename );
    if ( ! file )
        return 0;

    // Read file line-by-line until we reach ene-of-file

    string line = "";
    int count = 0;

    while ( getline ( file, line ) )
    {
        count++;
        ELPPertSeries ser;

        if ( line.find ( "LONGITUDE" ) != string::npos )
            ser.iv = 1;
        else if ( line.find ( "LATITUDE" ) != string::npos )
            ser.iv = 2;
        else if ( line.find ( "DISTANCE") != string::npos )
            ser.iv = 3;
        else
            return count;
        
        ser.nt = strtoint ( line.substr ( 30, 5 ) );
        ser.it = strtoint ( line.substr ( 44, 1 ) );

        for ( int i = 0; i < ser.nt; i++ )
        {
            if ( ! getline ( file, line ) )
                break;
            
            count++;
            ELPPertTerm term;
            
            term.s  = strtofloat64 ( line.substr (  5, 16 ) ) * pow ( 10.0, strtoint ( line.substr ( 22, 3 ) ) );
            term.c  = strtofloat64 ( line.substr ( 25, 16 ) ) * pow ( 10.0, strtoint ( line.substr ( 42, 3 ) ) );
            
            for ( int k = 0; k < 13; k++ )
                term.i[k] = strtoint ( line.substr ( 45 + 3 * k, 3 ) );
            
            ser.terms.push_back ( term );
        }
        
        sort ( ser.terms.begin(), ser.terms.end(), compareELPPertTerms );
        pert.push_back ( ser );
    }

    if ( pert[0].iv == 1 )
        pertLon = pert;
    else if ( pert[0].iv == 2 )
        pertLat = pert;
    else if ( pert[0].iv == 3 )
        pertDist = pert;

#if PRINT_SERIES
    ofstream outfile ( filename + ".cpp" );
    if ( outfile )
        printPertSeries ( outfile, pert );
#endif
    
    return count;
}

// Exports an ELPMainSeries series (ser) as C++ source code to an output stream (out).
// If TRUNC_FACTOR is #defined to be > 1, a trunctated subset of terms are exported.

void ELPMPP02::printMainSeries ( ostream &out, const ELPMainSeries &ser )
{
    out << "#include \"ELPMPP02.hpp\"\n" << endl;
    out << "static ELPMainSeries ";
    
    if ( ser.iv == 1 )
        out << "_lon_main";
    else if ( ser.iv == 2 )
        out << "_lat_main";
    else if ( ser.iv == 3 )
        out << "_dist_main";

    int nt = (int) ser.terms.size() / TRUNC_FACTOR;
    out << format ( " = { %d, %d, {\n", ser.iv, nt );

    for ( int k = 0; k < nt; k++ )
    {
        const ELPMainTerm &term = ser.terms[k];
        
        out << format ( "{ %3d, %3d, %3d, %3d, %13.5f, %12.2f, %12.2f, %12.2f, %12.2f, %12.2f, %12.2f }",
                       term.i[0], term.i[1], term.i[2], term.i[3], term.a,
                       term.b[0], term.b[1], term.b[2], term.b[3], term.b[4], term.b[5] );

        if ( k < nt - 1 )
            out << ",\n";
        else
            out << "\n";
    }

    out << "} };\n";
}

// Exports a vector of ELPPertSeries (pert) as C++ source code to an output stream (out).
// If TRUNC_FACTOR is #defined to be > 1, a truncated subset of terms are exported.

void ELPMPP02::printPertSeries ( ostream &out, const vector<ELPPertSeries> &pert )
{
    out << "#include \"ELPMPP02.hpp\"\n" << endl;
    out << "static vector<ELPPertSeries> ";
    
    if ( pert[0].iv == 1 )
        out << "_lon_pert = {\n";
    else if ( pert[0].iv == 2 )
        out << "_lat_pert = {\n";
    else if ( pert[0].iv == 3 )
        out << "_dist_pert = {\n";

    for ( int k = 0; k < pert.size(); k++ )
    {
        const ELPPertSeries &ser = pert[k];
        
        int nt = (int) ser.terms.size() / TRUNC_FACTOR;
        out << format ( "{ %d, %d, %d, {\n", ser.iv, ser.it, nt );

        for ( int i = 0; i < nt; i++ )
        {
            const ELPPertTerm &term = ser.terms[i];
            
            out << format ( "{ %+.12e, %+.12e, ", term.s, term.c );
            for ( int j = 0; j < 12; j++ )
                out << format ( "%3d, ", term.i[j] );
            
            if ( i < nt - 1 )
                out << format ( "%3d },\n", term.i[12] );
            else
                out << format ( "%3d }\n", term.i[12] );
        }
        
        if ( k < pert.size() - 1 )
            out << "} },\n";
        else
            out << "} } };\n";
    }
}

// Computes Moon's geocentric position and velocity on a specific Julian Ephemeris Date (jed)
// in units of AU and AU per day, referred to the J2000 mean equatorial frame (ICRS).

bool ELPMPP02::computePositionVelocity ( double jed, SSVector &pos, SSVector &vel )
{
    static SSMatrix eclequ = SSCoordinates::getEclipticMatrix ( SSCoordinates::getObliquity ( SSTime::kJ2000 ) );
    double tj = jed - 2451545.0;

    // Make sure we have loaded or initialized required series terms.

#if ELPMPP02_EMBED_SERIES
    initSeries();
#endif

    if ( ! _init )
        return false;

    // Compute Moon's position and velocity in J2000 ecliptic frame
    // in AU and AU per day using mathematically-correct formulae.

    double xyz[6] = {0};
    get_position_velocity ( tj, xyz );

    pos.x = xyz[0];
    pos.y = xyz[1];
    pos.z = xyz[2];
    vel.x = xyz[3];
    vel.y = xyz[4];
    vel.z = xyz[5];
    
    // Transform results to equatorial frame and from km to AU.
    
    pos = eclequ * pos / SSCoordinates::kKmPerAU;
    vel = eclequ * vel / SSCoordinates::kKmPerAU;
    
    return true;
}
